import { MenuLinkStyles } from './MenuLinkStyles';

export default function MenuLink({ product }) {
  console.log(product);
  return (
    <MenuLinkStyles>
      <a href='{product.title}'>
        <p>{product.title}</p>
      </a>
    </MenuLinkStyles>
  );
}
